-- 이벤트 assj.DELCLOSEDT 구조 내보내기
DELIMITER //
CREATE EVENT `DELCLOSEDT` ON SCHEDULE EVERY 1 DAY STARTS '2023-03-13 10:15:00' ENDS '2023-04-30 10:15:00' ON COMPLETION PRESERVE ENABLE DO CALL delCloseDtProc()//
DELIMITER ;

-- 프로시저 assj.delCloseDtProc 구조 내보내기
DELIMITER //
CREATE PROCEDURE `delCloseDtProc`()
BEGIN
	UPDATE company
		SET closeDt = REPLACE(closeDt,'채용시까지','')
		WHERE closeDt LIKE "%채용시까지%";
	delete FROM company 
		WHERE STR_TO_DATE(closeDt, '%Y-%m-%d')  < DATE_FORMAT(CURDATE(), '%Y-%m-%d');
END//
DELIMITER ;

